import React, { Component } from 'react'
import SelectField from 'react-md/lib/SelectFields'
import { setActiveLanguage } from 'react-localize-redux';
import { connect } from 'react-redux'
import { languageKey } from '../../config'
import { updateUserSettings } from '../../routes/Account/modules/account'

class LanguageSelection extends Component {
    constructor(props) {
        super(props)
        this.state = {

        }
    }
    componentWillMount() {
        const languages = ['az', 'en', 'ru']
        const { routing, setActiveLanguage } = this.props
        const query = routing && routing.locationBeforeTransitions && routing.locationBeforeTransitions.query
        if (query.lang && languages.includes(query.lang)) {
            setActiveLanguage(query.lang)
        }
    }
    componentWillReceiveProps(nextProps) {
        const { setActiveLanguage, userSettings } = this.props
        if (nextProps.userSettings && !userSettings) {
            if (nextProps.userSettings.languageId === 1) {
                setActiveLanguage(languageKey.azerbaijani)
            } else if (nextProps.userSettings.languageId === 2) {
                setActiveLanguage(languageKey.english)
            }
        }
    }

    changeLanguage = (id) => {
        const { setActiveLanguage, updateUserSettings, isLoggedOut } = this.props
        switch (id) {
            case 1:
                setActiveLanguage(languageKey.azerbaijani)
                if (isLoggedOut) return
                updateUserSettings({
                    langCode: languageKey.azerbaijani,
                    languageId: 1,
                    theme: 'default'
                })
                break;
            case 2:
                setActiveLanguage(languageKey.english)
                if (isLoggedOut) return
                updateUserSettings({
                    langCode: languageKey.english,
                    languageId: 2,
                    theme: 'default'
                })
                break;
            default:
                setActiveLanguage(languageKey.azerbaijani)
                if (isLoggedOut) return
                updateUserSettings({
                    langCode: languageKey.azerbaijani,
                    languageId: 1,
                    theme: 'default'
                })
                break;
        }
    }

    render() {
        return (
            <div>
                <img onClick={() => { this.changeLanguage(1) }} className='lang_icon' src="data:image/svg+xml;utf8;base64," />
                <img onClick={() => { this.changeLanguage(2) }} className='lang_icon' src="data:image/svg+xml;utf8;base64," />
            </div>
        )
    }
}

const mapDispatchToProps = {
    setActiveLanguage,
    updateUserSettings
}

const mapStateToProps = (state) => ({
    userSettings: state.account.userSettings,
    routing: state.routing
})

export default connect(mapStateToProps, mapDispatchToProps)(LanguageSelection)